 enviados do Líbano, por um major desconhecido, para uma certa Hilde Moller Knag, garota a quem Sofia também não conhece. O mistério dos bilhetes e dos postais é o ponto de partida deste romance. De capítulo em capítulo, de ´lição´ em ´lição´, o leitor é convidado a percorrer toda a história da filosofia ocidental, ao mesmo tempo que se vê envolvido por um thriller. O livro é traduzido diretamente do norueguês.','9788535921892','21 cm x 14 cm',NULL);
