ca celebração do aniversário do Führer pela vizinhança. Teme a dona da loja da esquina, colaboradora do Terceiro Reich. Faz amizade com um garoto obrigado a integrar a Juventude Hitlerista. E ajuda o pai a esconder no porão um jovem judeu que escreve livros artesanais para contar a sua parte naquela história. A Morte, perplexa diante da violência humana, dá um tom leve e divertido à narrativa desse duro confronto entre a infância perdida e a crueldade do mundo adulto, um sucesso absoluto — e raro — de crítica e público. ','9788580574517','21 cm x 14 cm',NULL),('009','5','Livro','As Vantagens de Ser Invisivel','',NULL,'Portugues','1','1','Rocco','Stephen Chbosky','223','2007','Brasil','Cartas mais íntimas que um diário, estranhamente únicas, hilárias e devastadoras - são apenas através delas que Charlie compartilha todo o seu mundinho com o leitor. Enveredando pelo universo dos primeiros encontros, dramas familiares, novos amigos, sexo, drogas e daquela música perfeita que nos faz sentir infinito, o roteirista Stephen Chbosky lança luz sobre o amadurecimento no ambiente da escola, um local por vezes opressor e sinônimo de ameaça. Uma leitura que deixa visível os problemas e crises próprios da juventude. ','9788532522337','21 cm x 14 cm',NULL);
